params.description:
- Options to customize to Web2Cal.
                 <br/>
                 For a complete list of customizations {@link Web2Cal.defaults}

example:
[
    , {eventId: 1, startTime:Date.parse("07/11/2013 1:00PM"), endTime: Date.parse("07/11/2013 2:00PM")}
    , {eventId: 2, startTime:Date.parse("07/11/2013 2:00PM"), endTime: Date.parse("07/11/2013 3:00PM")}
    , {eventId: 3, startTime:Date.parse("07/11/2013 4:00PM"), endTime: Date.parse("07/11/2013 5:00PM")}
    , {eventId: 4, startTime:Date.parse("06/04/2013 11:00AM"), endTime: Date.parse("06/04/2013 12:00PM"), repeatEvent:{mode:"day", day:{onlyWeekDays:true}
                                   , endDate: new Date(2014, 11, 11)
                                   , repeatCount: 1} }
    ]

